import React from 'react';
import './home.css'

export default function Home(){

    function login(){
        let username = document.getElementById("user").title;
        let password = document.getElementById("pass").title;
        console.log(username);
        console.log(password);

    }

    return(
        <div class="log-form">
  <h2 className="loginheader">Login to your account</h2>
  <form>
    <input id = "user" type="text" title="username" placeholder="username" />
    <input id = "pass" type="text" title="password" placeholder="password" />
    <button onClick={login}type="submit" class="btn">Login</button>

  </form>
</div>
    )}
